import OverviewPage from './OverviewPage';
import { connect } from 'react-redux';

const mapStateToProps = (state) => {
    let props = {
        statsLoaded: state.statsLoaded,
        uniqueUsers: state.uniqueUsers,
        uniqueSessions: state.uniqueSessions,
        requestCount: state.requestCount,
        maxTopicCount: 0,
        recognized: state.recognized,
        notRecognized: state.notRecognized,
        recognizedPercent: 100
    };

    if (state.statsLoaded) {
        props.recognizedPercent = Math.round(100 * (props.recognized / (props.recognized + props.notRecognized)))
    }

    return props
}

export default connect(mapStateToProps)(OverviewPage)
